INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "春咲 ひより", 0, 1, 0, 1, 0, 1, 1001, 0, 1.4, "お！\nあそこに困ってそうな人発見！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "わ、わたし、\nなに言ってるんだろ\nあはは…", "みんなみたいに\nわたしも強くならなきゃ", "草野 優衣", 0, 1, 0, 1, 0, 1, 1002, 0, 1.4, "大切な人を\n守れるようになりたい…って", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "少しは磨かれると思いますよ。", "フェンシングを始めてみては？", "士条 怜", 0, 1, 0, 1, 0, 1, 1003, 0, 1.4, "キミに必要な集中力と感性が", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "みそぎはねぇ、\nかくれんぼやりたい！", "ねぇ、にいちゃん！", "穂高 みそぎ", 0, 1, 0, 1, 0, 1, 1004, 0, 1.5, "今日はなにして遊ぶ？", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "私といっしょに…\nいかない？", "風宮あかりです", "風宮 あかり", 0, 1, 0, 1, 0, 1, 1006, 0, 1.4, "ねぇ…", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "食べ物の恨みは怖いのー", "出雲宮子なのー", "出雲 宮子", 0, 1, 0, 1, 0, 1, 1007, 0, 1.5, "プリンたべたいのー", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "いいよ。\n見られることは運命さ…", "ボクは虹村雪。", "虹村 雪", 0, 1, 0, 1, 0, 1, 1008, 0, 1.4, "キミもボクの美貌に\n吸い寄せられたんだね。", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "人呼んで「疾風の冥姫」!!", "フッ…聞いて後悔するがいい！", "柊杏奈", 0, 1, 0, 1, 0, 1, 1009, 0, 1.4, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "ほんまおおきにやわ～♪", "マホマホ王国のプリンセス、\nまほ姫どす", "姫宮 真歩", 0, 1, 0, 1, 0, 1, 1010, 0, 1.5, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "ここで会ったが\n100年目～！", "衣之咲璃乃です！", "衣之咲 璃乃", 0, 1, 0, 1, 0, 1, 1011, 0, 1.4, "生き別れたお兄ちゃんを探して\n三千世界！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "…って、お願い！\n誰にも言わないでおいて～！", "私はハツネ、\n結構強いんだよ。\nきらーん☆", "柏崎 初音", 0, 1, 0, 1, 0, 1, 1012, 0, 1.4, "ち、超能力って…\n何のことかな～？", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "ちょす！\n美波鈴奈だよ～♪", "美波 鈴奈", 0, 1, 0, 1, 0, 1, 1016, 0, 1.4, "一応カリスマ読モJKやってまっす！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "でも、沖縄もとってもいいとこさー", "はいたーい。\n喜屋武香織さー。", "喜屋武 香織", 0, 1, 0, 1, 0, 1, 1017, 0, 1.4, "東京は遊園地みたいなところさー", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "イオちゃんって呼んでね。", "支倉伊緒です。", "支倉 伊緒", 0, 1, 0, 1, 0, 1, 1018, 0, 1.4, "先生って呼ばれるのは\nくすぐったいから", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "ミミをおいてかないでぇ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "茜 ミミ", 0, 1, 0, 1, 0, 1, 1020, 0, 1.5, "あ！/\お兄ちゃ～ん\nまってよ～", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "ふぇぇぇぇぇん……", "あ…あの…えっと…\n栗…林…くるみ…です……", "栗林 くるみ", 0, 1, 0, 1, 0, 1, 1021, 0, 1.5, "あの……\nふぇ……", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "なんてありがとうございます！", "風宮よりです。\nあああああ！", "風宮 より", 0, 1, 0, 1, 0, 1, 1022, 0, 1.4, "こんな私に貴重な時間を\n割いていただき、", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "私こっち行きたいー\nね、早く早くー", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "北条 綾音", 0, 1, 0, 1, 0, 1, 1023, 0, 1.5, "おにいちゃんどこいくの？\nえ？", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "これて何か違う…\nあああすみません！", "わっ…わっ…私、\n天野すずめといいます！", "天野 すずめ", 0, 1, 0, 1, 0, 1, 1025, 0, 1.4, "ふ、不束者ですが\nどうぞ末永く…って、", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "離しませんわ………\n絶対に…!!", "……クスクス…私は\n…倉石恵理子……", "倉石 恵理子", 0, 1, 0, 1, 0, 1, 1027, 0, 1.4, "あなたは…運命の……\n伴侶……", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "…そうでしょ？？", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "佐々木 咲恋", 0, 1, 0, 1, 0, 1, 1028, 0, 1.4, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "あはは、\n私もまだまだだなぁ～", "桜井望だよ！\nよろしくねっ", "桜井 望", 0, 1, 0, 1, 0, 1, 1029, 0, 1.4, "ぇっと…\nキミ、私のこと知らないの?!", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "ショーグン、\nワタシと一緒に天下統一デース！", "デケデケデンっ！", "ニノン・ジュベール", 0, 1, 0, 1, 0, 1, 1030, 0, 1.4, "初めまして、\n私はニノン・ジュベール申すデス！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "おかしいですね……", "上喜しのぶです。\n手元のドクロが父です。", "上喜 しのぶ", 0, 1, 0, 1, 0, 1, 1031, 0, 1.4, "でもって私の隣にいるのが……\nえ、見えない？", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "そう、\nオラのボケに突っ込める相方が…！", "目指すはビッグな\nお笑い芸人だっぺ！", "野戸まひる", 0, 1, 0, 1, 0, 1, 1033, 0, 1.5, "けんども\nそれには足りないモンが…", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "ちょ\nちょっと一杯飲んできます…！", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "綾瀬 ゆかり", 0, 1, 0, 1, 0, 1, 1034, 0, 1.4, "ちょっと緊張しちゃって…", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "これ以上お話しすることは…\nないです！", "氷川鏡華…です", "氷川 鏡華", 0, 1, 0, 1, 0, 1, 1036, 0, 1.5, "知らない人とは話しちゃいけないので", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "柏崎…栞です。", "柏崎 栞", 0, 1, 0, 1, 0, 1, 1038, 0, 1.4, "……あ、アラーム。", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "野に咲く花が、\n唯一の話相手です。", "ふ、双葉碧です。", "双葉 碧", 0, 1, 0, 1, 0, 1, 1040, 0, 1.4, "私、一人も友達がいなくて……", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "そう思っています。", "三角千歌です。", "三角 千歌", 0, 1, 0, 1, 0, 1, 1042, 0, 1.4, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "う、疑ってすまなかったな…", "安芸真琴だ。", "安芸 真琴", 0, 1, 0, 1, 0, 1, 1043, 0, 1.4, "あぁ？\nお前のそいつの仲間か？", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "わらわこそは夜を総べる者！", "イリヤ・オーンスタイン", 0, 1, 0, 1, 0, 1, 1044, 0, 1.4, "生けとし生ける全ての者よ！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "ｌク、クウカに何かご用ですか!?", "そこで騎士は妖精を乱暴に……", "遠見 空花", 0, 1, 0, 1, 0, 1, 1045, 0, 1.4, "ぐふふふふ……はっ！", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "う～ん…\n猫ってホントに最高にゃ～♪", "宮坂たまきにゃ♪\n猫はいいにゃよ？", "宮坂たまき", 0, 1, 0, 1, 0, 1, 1046, 0, 1.4, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "大神美冬よ！", "大神 美冬", 0, 1, 0, 1, 0, 1, 1048, 0, 1.4, "それでは早速クエストに…", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "星野静流だよ！", "星野静流", 0, 1, 0, 1, 0, 1, 1049, 0, 1.4, "クエストもバトルも\n掃除も洗濯も", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "アタシは玉泉美咲。", "玉泉美咲", 0, 1, 0, 1, 0, 1, 1050, 0, 1.5, "見ての通りの\nセクシー美少女で", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "？？？？", "？？？", "リマ", 0, 1, 0, 1, 0, 1, 1052, 0, 1.4, "？？？？", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", "モニカ・ヴァイスヴィント", 0, 1, 0, 1, 0, 1, 1053, 0, 1.5, "菓子でつろうなどと\n稚拙な策を……", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", "ペコリーヌ", 0, 1, 0, 1, 0, 1, 1058, 0, 1.5, "菓子でつろうなどと\n稚拙な策を……", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", "コッコロ", 0, 1, 0, 1, 0, 1, 1059, 0, 1.5, "菓子でつろうなどと\n稚拙な策を……", 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", "キャル", 0, 1, 0, 1, 0, 1, 1060, 0, 1.5, "菓子でつろうなどと\n稚拙な策を……", 0);
